import '../estilos/header.css';
import logo from '../assets/bitmap.jpg'
export const Header = () => {
  return (
    <header className='header'>
        <img id='logo' src={logo}></img>
        <h1 className='title'>ShopMo</h1>

    </header>
  )
}
